--
-- Table structure for table `user_profiles`
--

DROP TABLE IF EXISTS `user_profiles`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user_profiles` (
  `user_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `avatar` bigint(20) unsigned DEFAULT 1,
  `first_name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Имя',
  `last_name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Фамилия',
  `gender` enum('m','f') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Пол',
  `date_of_birth` date DEFAULT NULL COMMENT 'Дата рождения',
  `country` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Страна',
  `about` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'О себе',
  `is_private` bit(1) DEFAULT b'0',
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`user_id`),
  KEY `user_name_idx` (`first_name`,`last_name`),
  KEY `avatar` (`avatar`),
  CONSTRAINT `user_profiles_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `user_profiles_ibfk_2` FOREIGN KEY (`avatar`) REFERENCES `images` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

